import { Row, Col } from "react-bootstrap";
import { connect } from "react-redux";
import "./chart.css";

type PropsTypeInputsChart = {
    title: string;
    callback: string;
    value: string;
};

const InputsChart = (props: PropsTypeInputsChart) => {
    const { title, callback, value } = props;

    return (
        <p className="inputsChart">
            {title} <span className="required"></span>
            <br />
            <input type="text" name="your-name" value=""  className="" style={{ height: "90px", width: "350px" }} />{" "}
        </p>
    );
};

const Chart = () => {
    return (
        <>
            <div className="body">
                <div className="body-container">
                    <div style={{ height: "100%", width: "100%", position: "relative" }}>
                        <Row style={{ height: "100%", width: "100%" }}>
                            <Col md={{ offset: 1, span: 10 }} style={{ backgroundColor: "red" }}>
                                g
                            </Col>
                        </Row>
                    </div>
                </div>
                <div className="body-inputsContainer">
                    <Row className="inputRowContainer">
                        <Col md={{ offset: 1, span: 4 }}>
                            <InputsChart title={"title"} callback={"fn"} value={"3"} />
                        </Col>
                    </Row>
                    <Row className="inputRowContainer">
                        <Col md={{ offset: 1, span: 5 }}>
                            <InputsChart title={"title"} callback={"fn"} value={"3"} />
                        </Col>
                        <Col md={{ offset: 0, span: 5 }}>
                            <InputsChart title={"title"} callback={"fn"} value={"3"} />
                        </Col>
                    </Row>
                </div>
            </div>
        </>
    );
};

// export default Chart

export default connect(null, null)(Chart);
